import React, {Component} from 'react'
import Orii from './assets/orii.svg'

class home extends React.Component{

constructor(){
this.handleSubmit = this.handleSubmit.bind(this)
}

handleSubmit(event){
event.prevenDefault();

const data = new FormData(event.target)
fetch( 'localhost:5000/login',{
    method:'POST',
    body: data
})
}

    render(){
        return(
            <div className="login-bg">
            {/* Group contents container */}
            <div id='login-group'>
                <div id='logo-container'>
                <img id='logo' src={Orii} alt='orii-logo'></img>
                </div>

                <div id='form-container'>
                    <form onSubmit={this.handleSubmit} id='form-data'>
                        <label id='email'>Email</label>
                        <input className='cus-input' type='text' placeholder='Email'></input>
                        <label id='email'>Password</label>
                        <input className='cus-input' type='text' placeholder='Password'></input>
                        <input id='submit-btn' type='submit' value='Submit'></input>
                    </form>
                    <div id='sign-up-link'>
                        <div className='links' id='sign-up'><a href='#'>Sign up</a></div>
                        <div className='links'><a href='#'>Forgot password</a></div>
                    </div>

                </div>
            </div>



            </div>
        )}
}

export default home;
